    "mtr_8": { command: "mtr", section: 8, description: "network diagnostic tool", content: "MTR(8)                     Manual Page                     MTR(8)\n\nNAME\n       mtr - network diagnostic tool\n\nSYNOPSIS\n       mtr [options] [arguments]\n\nDESCRIPTION\n       network diagnostic tool\n\n       Network diagnostic tool combining ping and traceroute.\n\nCOMMON OPTIONS\n       mtr hostname                        Interactive mode\n       mtr -r hostname                     Report mode\n       mtr -c 10 hostname                  Send 10 packets\n       mtr --tcp hostname                  Use TCP instead of ICMP\n\n\nSEE ALSO\n       Full documentation available where this command is installed.\n\n" },
