    "docker-compose_1": { command: "docker-compose", section: 1, description: "define and run multi-container Docker applications", content: "DOCKER-COMPOSE(1)                     Manual Page                     DOCKER-COMPOSE(1)\n\nNAME\n       docker-compose - define and run multi-container Docker applications\n\nSYNOPSIS\n       docker-compose [options] [arguments]\n\nDESCRIPTION\n       define and run multi-container Docker applications\n\n       Tool for defining and running multi-container Docker applications.\n\nCOMMON COMMANDS\n       docker-compose up                   Start services\n       docker-compose down                 Stop services\n       docker-compose ps                   List containers\n       docker-compose logs                 View output\n\n\nSEE ALSO\n       Full documentation available where this command is installed.\n\n" },
    "kubectl_1": { command: "kubectl", section: 1, description: "Kubernetes command-line tool", content: "KUBECTL(1)                     Manual Page                     KUBECTL(1)\n\nNAME\n       kubectl - Kubernetes command-line tool\n\nSYNOPSIS\n       kubectl [options] [arguments]\n\nDESCRIPTION\n       Kubernetes command-line tool\n\n       Command-line tool for interacting with Kubernetes clusters.\n\nCOMMON COMMANDS\n       kubectl get pods                    List all pods\n       kubectl describe pod <name>         Show pod details\n       kubectl logs <pod>                  View pod logs\n       kubectl apply -f <file>             Apply configuration\n\n\nSEE ALSO\n       Full documentation available where this command is installed.\n\n" },
