    "openssl_1": { command: "openssl", section: 1, description: "OpenSSL cryptography toolkit", content: "OPENSSL(1)                     User Commands                     OPENSSL(1)\n\nNAME\n       openssl - OpenSSL cryptography toolkit\n\nSYNOPSIS\n       openssl [OPTION]... [ARGUMENTS]...\n\nDESCRIPTION\n       OpenSSL cryptography toolkit\n\nOPTIONS\n       -h, --help\n              display this help and exit\n\n       -V, --version\n              output version information and exit\n\nEXAMPLES\n       openssl --help\n              Display help information\n\n       openssl [arguments]\n              Basic usage of openssl\n\nEXIT STATUS\n       0      if OK,\n       1      if minor problems (e.g., cannot access subdirectory),\n       2      if serious trouble (e.g., cannot access command-line argument).\n\nFILES\n       ~/.opensslrc\n              User's personal configuration file\n\nSEE ALSO\n       Full documentation <https://www.gnu.org/software/coreutils/openssl>\n       or available locally via: info '(coreutils) openssl invocation'\n\nREPORTING BUGS\n       Online help: <https://www.gnu.org/software/coreutils/>\n       Report openssl translation bugs to <https://translationproject.org/team/>\n\nCOPYRIGHT\n       Copyright © 2023 Free Software Foundation, Inc.  License GPLv3+: GNU GPL version 3 or later <https://gnu.org/licenses/gpl.html>.\n       This is free software: you are free to change and redistribute it.  There is NO WARRANTY, to the extent permitted by law.\n\nAUTHOR\n       Written by the GNU coreutils development team.\n\nGNU coreutils 9.1               January 2025                OPENSSL(1)" },
