    "accept_2": { command: "accept", section: 2, description: "accept connection", content: "ACCEPT(2)                     System Calls Manual                     ACCEPT(2)\n\nNAME\n       accept - accept connection\n\nSYNOPSIS\n       int accept(/* parameters */);\n\nDESCRIPTION\n       The accept() system call accept connection.\n\nRETURN VALUE\n       On success, returns appropriate value. On error, returns -1 and sets errno appropriately.\n\nERRORS\n       EACCES Permission denied.\n       EBADF  Bad file descriptor.\n       EINVAL Invalid argument.\n       ENOMEM Out of memory.\n\nCONFORMING TO\n       POSIX.1-2001, POSIX.1-2008, SVr4, 4.3BSD.\n\nNOTES\n       For more details on system call behavior, consult the system documentation.\n\nSEE ALSO\n       syscalls(2), errno(3), feature_test_macros(7)\n\nCOLOPHON\n       This page is part of release 5.13 of the Linux man-pages project. A description of the project, information about reporting bugs, and the latest version of this page, can be found at https://www.kernel.org/doc/man-pages/.\n\nLinux                            January 2025                            ACCEPT(2)" },
    "access_2": { command: "access", section: 2, description: "check permissions", content: "ACCESS(2)                     System Calls Manual                     ACCESS(2)\n\nNAME\n       access - check permissions\n\nSYNOPSIS\n       int access(/* parameters */);\n\nDESCRIPTION\n       The access() system call check permissions.\n\nRETURN VALUE\n       On success, returns appropriate value. On error, returns -1 and sets errno appropriately.\n\nERRORS\n       EACCES Permission denied.\n       EBADF  Bad file descriptor.\n       EINVAL Invalid argument.\n       ENOMEM Out of memory.\n\nCONFORMING TO\n       POSIX.1-2001, POSIX.1-2008, SVr4, 4.3BSD.\n\nNOTES\n       For more details on system call behavior, consult the system documentation.\n\nSEE ALSO\n       syscalls(2), errno(3), feature_test_macros(7)\n\nCOLOPHON\n       This page is part of release 5.13 of the Linux man-pages project. A description of the project, information about reporting bugs, and the latest version of this page, can be found at https://www.kernel.org/doc/man-pages/.\n\nLinux                            January 2025                            ACCESS(2)" },
    "apropos_1": { command: "apropos", section: 1, description: "search man pages", content: "APROPOS(1)                     User Commands                     APROPOS(1)\n\nNAME\n       apropos - search man pages\n\nSYNOPSIS\n       apropos [OPTION]... [ARGUMENTS]...\n\nDESCRIPTION\n       search man pages\n\nOPTIONS\n       -h, --help\n              display this help and exit\n\n       -V, --version\n              output version information and exit\n\nEXAMPLES\n       apropos --help\n              Display help information\n\n       apropos [arguments]\n              Basic usage of apropos\n\nEXIT STATUS\n       0      if OK,\n       1      if minor problems (e.g., cannot access subdirectory),\n       2      if serious trouble (e.g., cannot access command-line argument).\n\nFILES\n       ~/.aproposrc\n              User's personal configuration file\n\nSEE ALSO\n       Full documentation <https://www.gnu.org/software/coreutils/apropos>\n       or available locally via: info '(coreutils) apropos invocation'\n\nREPORTING BUGS\n       Online help: <https://www.gnu.org/software/coreutils/>\n       Report apropos translation bugs to <https://translationproject.org/team/>\n\nCOPYRIGHT\n       Copyright © 2023 Free Software Foundation, Inc.  License GPLv3+: GNU GPL version 3 or later <https://gnu.org/licenses/gpl.html>.\n       This is free software: you are free to change and redistribute it.  There is NO WARRANTY, to the extent permitted by law.\n\nAUTHOR\n       Written by the GNU coreutils development team.\n\nGNU coreutils 9.1               January 2025                APROPOS(1)" },
