    "open_2": { command: "open", section: 2, description: "open file", content: "OPEN(2)                     System Calls Manual                     OPEN(2)\n\nNAME\n       open - open file\n\nSYNOPSIS\n       #include <sys/types.h>\\n       #include <sys/stat.h>\\n       #include <fcntl.h>\\n\\n       int open(const char *pathname, int flags);\\n       int open(const char *pathname, int flags, mode_t mode);\n\nDESCRIPTION\n       The open() system call opens the file specified by pathname. If the specified file does not exist, it may optionally (if O_CREAT is specified in flags) be created by open().\n\nRETURN VALUE\n       open() returns the new file descriptor (a nonnegative integer), or -1 if an error occurred (in which case, errno is set appropriately).\n\nERRORS\n       EACCES The requested access to the file is not allowed, or search permission is denied for one of the directories in the path prefix of pathname, or the file did not exist yet and write access to the parent directory is not allowed.\n\n       EDQUOT Where O_CREAT is specified, the file does not exist, and the user's quota of disk blocks or inodes on the filesystem has been exhausted.\n\n       EEXIST pathname already exists and O_CREAT and O_EXCL were used.\n\n       EFAULT pathname points outside your accessible address space.\n\n       EFBIG  See EOVERFLOW.\n\n       EINTR  While blocked waiting to complete an open of a slow device (e.g., a FIFO; see fifo(7)), the call was interrupted by a signal handler; see signal(7).\n\n       EINVAL The filesystem does not support the O_DIRECT flag. See NOTES for more information.\n\n       EISDIR pathname refers to a directory and the access requested involved writing (that is, O_WRONLY or O_RDWR is set).\n\n       ELOOP  Too many symbolic links were encountered in resolving pathname.\n\n       EMFILE The per-process limit on the number of open file descriptors has been reached (see the description of RLIMIT_NOFILE in getrlimit(2)).\n\n       ENAMETOOLONG\n              pathname was too long.\n\n       ENFILE The system-wide limit on the total number of open files has been reached.\n\n       ENODEV pathname refers to a device special file and no corresponding device exists. (This is a Linux kernel bug; in this situation ENXIO must be returned.)\n\n       ENOENT O_CREAT is not set and the named file does not exist. Or, a directory component in pathname does not exist or is a dangling symbolic link.\n\n       ENOMEM The named file is a FIFO, but memory for the FIFO buffer cannot be allocated because the per-user hard limit on memory allocation for pipes has been reached and the caller is not privileged; see pipe(7).\n\n       ENOSPC pathname was to be created but the device containing pathname has no room for the new file.\n\n       ENOTDIR\n              A component used as a directory in pathname is not, in fact, a directory, or O_DIRECTORY was specified and pathname is not a directory.\n\n       ENXIO  O_NONBLOCK | O_WRONLY is set, the named file is a FIFO, and no process has the FIFO open for reading.\n\n       EOVERFLOW\n              pathname refers to a regular file that is too large to be opened. The usual scenario here is that an application compiled on a 32-bit platform without -D_FILE_OFFSET_BITS=64 tries to open a file whose size exceeds (1<<31)-1 bytes; see also O_LARGEFILE above.\n\n       EPERM  The O_NOATIME flag was specified, but the effective user ID of the caller did not match the owner of the file and the caller was not privileged.\n\n       EROFS  pathname refers to a file on a read-only filesystem and write access was requested.\n\n       ETXTBSY\n              pathname refers to an executable image which is currently being executed and write access was requested.\n\n       EWOULDBLOCK\n              The O_NONBLOCK flag was specified, and an incompatible lease was held on the file (see fcntl(2)).\n\nCONFORMING TO\n       POSIX.1-2001, POSIX.1-2008, SVr4, 4.3BSD.\n\nNOTES\n       For more details on system call behavior, consult the system documentation.\n\nSEE ALSO\n       syscalls(2), errno(3), feature_test_macros(7)\n\nCOLOPHON\n       This page is part of release 5.13 of the Linux man-pages project. A description of the project, information about reporting bugs, and the latest version of this page, can be found at https://www.kernel.org/doc/man-pages/.\n\nLinux                            January 2025                            OPEN(2)" },
    "passwd_1": { command: "passwd", section: 1, description: "change password", content: "PASSWD(1)                     User Commands                     PASSWD(1)\n\nNAME\n       passwd - change password\n\nSYNOPSIS\n       passwd [OPTION]... [ARGUMENTS]...\n\nDESCRIPTION\n       change password\n\nOPTIONS\n       -h, --help\n              display this help and exit\n\n       -V, --version\n              output version information and exit\n\nEXAMPLES\n       passwd --help\n              Display help information\n\n       passwd [arguments]\n              Basic usage of passwd\n\nEXIT STATUS\n       0      if OK,\n       1      if minor problems (e.g., cannot access subdirectory),\n       2      if serious trouble (e.g., cannot access command-line argument).\n\nFILES\n       ~/.passwdrc\n              User's personal configuration file\n\nSEE ALSO\n       Full documentation <https://www.gnu.org/software/coreutils/passwd>\n       or available locally via: info '(coreutils) passwd invocation'\n\nREPORTING BUGS\n       Online help: <https://www.gnu.org/software/coreutils/>\n       Report passwd translation bugs to <https://translationproject.org/team/>\n\nCOPYRIGHT\n       Copyright © 2023 Free Software Foundation, Inc.  License GPLv3+: GNU GPL version 3 or later <https://gnu.org/licenses/gpl.html>.\n       This is free software: you are free to change and redistribute it.  There is NO WARRANTY, to the extent permitted by law.\n\nAUTHOR\n       Written by the GNU coreutils development team.\n\nGNU coreutils 9.1               January 2025                PASSWD(1)" },
    "passwd_5": { command: "passwd", section: 5, description: "password file", content: "PASSWD(5)                     File Formats Manual                     PASSWD(5)\n\nNAME\n       passwd - password file\n\nDESCRIPTION\n       This manual page describes the passwd file format.\n\n       password file\n\nFORMAT\n       The passwd file contains configuration data in a structured format.\n       Each line represents a configuration directive or data entry.\n\nSYNTAX\n       Lines beginning with # are treated as comments and are ignored.\n       Empty lines are also ignored.\n\nFILES\n       /etc/passwd\n              System-wide passwd file\n\n       ~/.passwd\n              User-specific passwd file\n\nEXAMPLES\n       # Example passwd configuration\n       # This is a comment\n       option1=value1\n       option2=value2\n\nSEE ALSO\n       passwd(1), passwd(8), file-hierarchy(7)\n\nNOTES\n       For more detailed information about the passwd file format,\n       consult the system documentation.\n\nLinux                            January 2025                            PASSWD(5)" },
