    "pip3_1": { command: "pip3", section: 1, description: "Python package installer", content: "PIP3(1)                     User Commands                     PIP3(1)\n\nNAME\n       pip3 - Python package installer\n\nSYNOPSIS\n       pip3 [OPTION]... [ARGUMENTS]...\n\nDESCRIPTION\n       Python package installer\n\nOPTIONS\n       -h, --help\n              display this help and exit\n\n       -V, --version\n              output version information and exit\n\nEXAMPLES\n       pip3 --help\n              Display help information\n\n       pip3 [arguments]\n              Basic usage of pip3\n\nEXIT STATUS\n       0      if OK,\n       1      if minor problems (e.g., cannot access subdirectory),\n       2      if serious trouble (e.g., cannot access command-line argument).\n\nFILES\n       ~/.pip3rc\n              User's personal configuration file\n\nSEE ALSO\n       Full documentation <https://www.gnu.org/software/coreutils/pip3>\n       or available locally via: info '(coreutils) pip3 invocation'\n\nREPORTING BUGS\n       Online help: <https://www.gnu.org/software/coreutils/>\n       Report pip3 translation bugs to <https://translationproject.org/team/>\n\nCOPYRIGHT\n       Copyright © 2023 Free Software Foundation, Inc.  License GPLv3+: GNU GPL version 3 or later <https://gnu.org/licenses/gpl.html>.\n       This is free software: you are free to change and redistribute it.  There is NO WARRANTY, to the extent permitted by law.\n\nAUTHOR\n       Written by the GNU coreutils development team.\n\nGNU coreutils 9.1               January 2025                PIP3(1)" },
    "pipe_2": { command: "pipe", section: 2, description: "create pipe", content: "PIPE(2)                     System Calls Manual                     PIPE(2)\n\nNAME\n       pipe - create pipe\n\nSYNOPSIS\n       int pipe(/* parameters */);\n\nDESCRIPTION\n       The pipe() system call create pipe.\n\nRETURN VALUE\n       On success, returns appropriate value. On error, returns -1 and sets errno appropriately.\n\nERRORS\n       EACCES Permission denied.\n       EBADF  Bad file descriptor.\n       EINVAL Invalid argument.\n       ENOMEM Out of memory.\n\nCONFORMING TO\n       POSIX.1-2001, POSIX.1-2008, SVr4, 4.3BSD.\n\nNOTES\n       For more details on system call behavior, consult the system documentation.\n\nSEE ALSO\n       syscalls(2), errno(3), feature_test_macros(7)\n\nCOLOPHON\n       This page is part of release 5.13 of the Linux man-pages project. A description of the project, information about reporting bugs, and the latest version of this page, can be found at https://www.kernel.org/doc/man-pages/.\n\nLinux                            January 2025                            PIPE(2)" },
    "poll_2": { command: "poll", section: 2, description: "wait for events", content: "POLL(2)                     System Calls Manual                     POLL(2)\n\nNAME\n       poll - wait for events\n\nSYNOPSIS\n       int poll(/* parameters */);\n\nDESCRIPTION\n       The poll() system call wait for events.\n\nRETURN VALUE\n       On success, returns appropriate value. On error, returns -1 and sets errno appropriately.\n\nERRORS\n       EACCES Permission denied.\n       EBADF  Bad file descriptor.\n       EINVAL Invalid argument.\n       ENOMEM Out of memory.\n\nCONFORMING TO\n       POSIX.1-2001, POSIX.1-2008, SVr4, 4.3BSD.\n\nNOTES\n       For more details on system call behavior, consult the system documentation.\n\nSEE ALSO\n       syscalls(2), errno(3), feature_test_macros(7)\n\nCOLOPHON\n       This page is part of release 5.13 of the Linux man-pages project. A description of the project, information about reporting bugs, and the latest version of this page, can be found at https://www.kernel.org/doc/man-pages/.\n\nLinux                            January 2025                            POLL(2)" },
