    "traceroute_1": { command: "traceroute", section: 1, description: "trace network path", content: "TRACEROUTE(1)                     User Commands                     TRACEROUTE(1)\n\nNAME\n       traceroute - trace network path\n\nSYNOPSIS\n       traceroute [OPTION]... [ARGUMENTS]...\n\nDESCRIPTION\n       trace network path\n\nOPTIONS\n       -h, --help\n              display this help and exit\n\n       -V, --version\n              output version information and exit\n\nEXAMPLES\n       traceroute --help\n              Display help information\n\n       traceroute [arguments]\n              Basic usage of traceroute\n\nEXIT STATUS\n       0      if OK,\n       1      if minor problems (e.g., cannot access subdirectory),\n       2      if serious trouble (e.g., cannot access command-line argument).\n\nFILES\n       ~/.tracerouterc\n              User's personal configuration file\n\nSEE ALSO\n       Full documentation <https://www.gnu.org/software/coreutils/traceroute>\n       or available locally via: info '(coreutils) traceroute invocation'\n\nREPORTING BUGS\n       Online help: <https://www.gnu.org/software/coreutils/>\n       Report traceroute translation bugs to <https://translationproject.org/team/>\n\nCOPYRIGHT\n       Copyright © 2023 Free Software Foundation, Inc.  License GPLv3+: GNU GPL version 3 or later <https://gnu.org/licenses/gpl.html>.\n       This is free software: you are free to change and redistribute it.  There is NO WARRANTY, to the extent permitted by law.\n\nAUTHOR\n       Written by the GNU coreutils development team.\n\nGNU coreutils 9.1               January 2025                TRACEROUTE(1)" },
