    "duplicity_1": { command: "duplicity", section: 1, description: "Encrypted backup", content: "DUPLICITY(1)                     User Commands                     DUPLICITY(1)\n\nNAME\n       duplicity - Encrypted backup\n\nSYNOPSIS\n       duplicity [OPTION]... [ARGUMENTS]...\n\nDESCRIPTION\n       Encrypted backup\n\nOPTIONS\n       -h, --help\n              display this help and exit\n\n       -V, --version\n              output version information and exit\n\nEXAMPLES\n       duplicity --help\n              Display help information\n\n       duplicity [arguments]\n              Basic usage of duplicity\n\nEXIT STATUS\n       0      if OK,\n       1      if minor problems (e.g., cannot access subdirectory),\n       2      if serious trouble (e.g., cannot access command-line argument).\n\nFILES\n       ~/.duplicityrc\n              User's personal configuration file\n\nSEE ALSO\n       Full documentation <https://www.gnu.org/software/coreutils/duplicity>\n       or available locally via: info '(coreutils) duplicity invocation'\n\nREPORTING BUGS\n       Online help: <https://www.gnu.org/software/coreutils/>\n       Report duplicity translation bugs to <https://translationproject.org/team/>\n\nCOPYRIGHT\n       Copyright © 2023 Free Software Foundation, Inc.  License GPLv3+: GNU GPL version 3 or later <https://gnu.org/licenses/gpl.html>.\n       This is free software: you are free to change and redistribute it.  There is NO WARRANTY, to the extent permitted by law.\n\nAUTHOR\n       Written by the GNU coreutils development team.\n\nGNU coreutils 9.1               January 2025                DUPLICITY(1)" },
    "logrotate_8": { command: "logrotate", section: 8, description: "Rotate log files", content: "LOGROTATE(8)                     System Manager's Manual                     LOGROTATE(8)\n\nNAME\n       logrotate - Rotate log files\n\nSYNOPSIS\n       logrotate [OPTIONS] [ARGUMENTS]\n\nDESCRIPTION\n       logrotate is a system administration command that rotate log files.\n\nOPTIONS\n       -h, --help\n              Display help information and exit\n\n       -V, --version\n              Display version information and exit\n\n       -v, --verbose\n              Enable verbose output\n\nEXAMPLES\n       logrotate --help\n              Display help information\n\n       logrotate [arguments]\n              Basic usage of logrotate\n\nFILES\n       /etc/logrotate.conf\n              Main configuration file\n\n       /var/log/logrotate.log\n              Log file\n\nENVIRONMENT\n       $SYSTEMD_PAGER\n              Pager to use when --no-pager is not given; overrides $PAGER. If neither $SYSTEMD_PAGER nor $PAGER are set, a set of well-known pager implementations are tried in turn, including less(1) and more(1), until one is found. If no pager implementation is discovered no pager is invoked. Setting this environment variable to an empty string or the value \"cat\" is equivalent to passing --no-pager.\n\n       $SYSTEMD_LESS\n              Override the options passed to less (by default \"FRSXMK\").\n\n       $SYSTEMD_LESSCHARSET\n              Override the charset passed to less (by default \"utf-8\", if the invoking terminal is determined to be UTF-8 compatible).\n\n       $SYSTEMD_PAGERSECURE\n              Takes a boolean argument. When true, the \"secure\" mode of the pager is enabled; if false, disabled. If $SYSTEMD_PAGERSECURE is not set at all, secure mode is enabled if the effective UID is not the same as the owner of the terminal device. In secure mode, LESSSECURE=1 will be set when invoking the pager, and the pager shall disable commands that open or create new files or start new subprocesses. When $SYSTEMD_PAGERSECURE is not set at all, pagers which are not known to implement secure mode will not be used. (Currently only less(1) implements secure mode.)\n\n       $SYSTEMD_COLORS\n              The value must be a boolean. Controls whether colorized output should be generated. This can be specified to override the decision that systemd makes based on $TERM and what the console is connected to.\n\n       $SYSTEMD_URLIFY\n              The value must be a boolean. Controls whether clickable links should be generated in the output for terminal emulators supporting this. This can be specified to override the decision that systemd makes based on $TERM and other conditions.\n\nSEE ALSO\n       systemd(1), journalctl(1), loginctl(1), machinectl(1), systemd.unit(5), systemd.special(7), wall(1), systemd.preset(5), systemd.generator(7), glob(7)\n\nsystemd 249                      January 2025                           LOGROTATE(8)" },
